html,body,div,span,applet,object,iframe,h1,h2,h3,h4,h5,h6,p,blockquote,pre,a,abbr,acronym,address,big,cite,code,del,dfn,em,img,ins,kbd,q,s,samp,small,strike,strong,sub,sup,tt,var,b,u,i,center,dl,dt,dd,ol,ul,li,fieldset,form,label,legend,table,caption,tbody,tfoot,thead,tr,th,td,article,aside,canvas,details,embed,figure,figcaption,footer,header,hgroup,menu,nav,output,ruby,section,summary,time,mark,audio,video {
            	margin:0;
            	padding:0;
            	border:0;
            	font:inherit;
            	font-size:100%;
            	vertical-align:baseline;
            }

            html {
            	line-height:1;
            }

            ol,ul {
            	list-style:none;
            }

            table {
            	border-collapse:collapse;
            	border-spacing:0;
            }

            caption,th,td {
            	text-align:left;
            	font-weight:400;
            	vertical-align:middle;
            }

            q,blockquote {
            	quotes:none;
            }

            q:before,q:after,blockquote:before,blockquote:after {
            	content:"";
            	content:none;
            }

            a img {
            	border:none;
            }

            article,aside,details,figcaption,figure,footer,header,hgroup,main,menu,nav,section,summary {
            	display:block;
            }

            * {
            	-webkit-font-smoothing:antialiased;
            	-moz-osx-font-smoothing:grayscale;
            }

            html,body {
            	height:100%;
            	min-height:100%;
            	background: #eeeeee;
            }

            body,button,input,select,textarea {
            	line-height:1.4;
            	font-weight:400;
            	font-family:"GTA-Regular","Helvetica Neue","Helvetica",Arial,sans-serif;
            	font-size:16px;
            	color: #5d6e73;
            }

            hr {
            	background:#2eaae2;
            	border:none;
            	display:inline-block;
            	width:24px;
            	height:2px;
            	margin:0 0 15px;
            }

            @media (min-width: 1500px) {
            	body,button,input,select,textarea {
            		font-size:18px;
            	}
            }

            strong {
            	font-weight:600;
            }

            em {
            	font-style:italic;
            }

            a {
            	color:#2eaae2;
            	text-decoration:none;
            }

            a:hover {
            	color:#007da2;
            }

            h1,h2,h3,h4,h5,h6 {
            	color: #37444c;
            	font-family: "GTA-Medium";
            	font-weight:500;
            }

            h1 {
            	font-family: "Fabriga-Black";
            	font-size:28px;
            	font-weight:700;
            	margin-bottom:10px;
            }

            @media (max-width: 440px) {
            	h1 {
            		font-size:20px;
            	}
            }

            @media (min-width: 1500px) {
            	h1 {
            		font-size:33px;
            	}
            }

            h2 {
            	font-size:23px;
            	margin-bottom:10px;
            }

            h3 {
            	font-size:20px;
            	margin-bottom:10px;
            }

            h4 {
            	font-size:17px;
            	font-weight:400;
            	margin-bottom:10px;
            }

            @media (max-width: 440px) {
            	h4 {
            		font-size:15px;
            	}
            }

            @media (min-width: 1500px) {
            	h4 {
            		font-size:19px;
            	}
            }

            h5 {
            	font-size:12px;
            	font-weight:500;
            	text-transform:uppercase;
            	color:#2eaae2;
            	margin-bottom:6px;
            }

            h6 {
            	font-size:11px;
            	font-weight:500;
            	text-transform:uppercase;
            	margin-bottom:6px;
            }

            p {
            	margin:0 0 30px;
            }

            .content-panel ul,
            .content-panel ol {
            	margin:0 0 50px 50px;
            }

            .content-panel ul li,
            .content-panel ol li {
            	list-style:square;
            	margin:0 0 15px;
            }

            .content-panel ul li p:last-child,
            .content-panel ol li p:last-child {
            	margin-bottom:0;
            }

            .content-panel ol li {
            	list-style:decimal;
            }

            .toc {
            	background-color:#39444b;
            	background-image:linear-gradient(180deg,#4f5e68 0%,#39444b 100%);
            	position:fixed;
            	left:0;
            	top:0;
            	z-index:5000;
            }

            @media (max-width: 849px) {
            	.toc {
            		position:absolute;
            		width:100%;
            		height:60px;
            	}
            }

            @media (max-width: 440px) {
            	.toc {
            		height:50px;
            	}
            }

            @media (min-width: 850px) {
            	.toc {
            		width:100px;
            		height:100%;
            	}
            }

            @media (min-width: 1200px) {
            	.toc {
            		width:100px;
            	}
            }

            .toc__inner {
            	-moz-box-sizing:border-box;
            	-webkit-box-sizing:border-box;
            	box-sizing:border-box;
            	position:absolute;
            	top:0;
            	left:0;
            	width:100%;
            	height:100%;
            }

            @media (max-width: 849px) {
            	.toc__inner {
            		padding:15px 6%;
            		padding-left:0;
            		padding-right:0;
            	}
            }

            @media (min-width: 850px) {
            	.toc__inner {
            		padding:25% 20%;
            	}
            }

            .toc__text {
            	text-align:right;
            }

            @media (max-width: 849px) {
            	.toc__text {
            		height:60px;
            		position:fixed;
            		right:0;
            		top:0;
            		z-index:999999;
            	}

            	.toc__text h2 {
            		color:#FFF;
            		line-height:59px;
            		margin:0;
            		padding:0 30px 0 0;
            	}
            }

            .toc__text h2 a {
        		color:#FFF;
        		opacity:.65;
            }

            .toc__text h1 a:hover {
                opacity:.85;
            }

            @media (max-width: 440px) {
            	.toc__text h2 {
            		line-height:49px;
            	}
            }

            @media (min-width: 850px) {
            	.toc__text {
            		-moz-transform:rotate(270deg);
            		-ms-transform:rotate(270deg);
            		-webkit-transform:rotate(270deg);
            		transform:rotate(270deg);
            		-moz-transform-origin:100% 0;
            		-ms-transform-origin:100% 0;
            		-webkit-transform-origin:100% 0;
            		transform-origin:100% 0;
            		position:absolute;
            		left:-300px;
            		top:0;
            		width:300px;
            		height:100px;
            	}

            	.toc__text h2 a {
            		line-height:98px;
            		margin:0;
            		padding:0 30px 0 0;
            	}
            }

            .toc__logo {
            	position:relative;
            	height:0;
            }

            @media (min-width: 850px) {
            	.toc__logo {
            		position:absolute;
            		bottom:15px;
            		left:38px;
            		width:187px;
            		height:28px;
            	}
            }

            @media (max-width: 849px) {

                left: -30px;
